  false,\n\t\"url\": null,\n\t\"notes\": \"Watershed Sciences, Inc. (WSI) collected
  Light Detection and Ranging (LiDAR) data on the Quinault River Basin survey area
  for the Puget Sound LiDAR Consortium and the Quinault Indian Nation. Delivery 1
  of the survey area was collected on April 16th, 29th, 30th, and May 1st, 2011 and
  delivered on June 14th, 2011. Delivery 2 of the survey area was collected on November
  6th -19th, and December 1st - 4th, 2011. This report documents the data acquisition,
  processing methods, accuracy assessment, and deliverables for the first 91,162 acres
  of Delivery 1 data and the final 144,033 acres of Delivery 2 data for a total of
  234,394 acres. The requested area was expanded to include a 100m buffer to ensure
  complete coverage and adequate point densities around survey area boundaries. The
  2012 Quinault River Basin data (Delivery 2) were integrated with overlapping portions
  of the 2011 data (Delivery 1) to provide seamless models.\",\n\t\"license_title\":
